import React from 'react';
import './Navbar.css'

 function Navbar(){
    return (
        <>
            
            <div className='navbar'>
            <button className="login"> Login </button>

            <button className="register"> Register </button>

            </div>
           
        </>
    )
}

export default Navbar;
